$templateCache.put("docs/quickstart-angular/sections/quickstart.section.html","<doc-section><doc-header id=\"quickstart\">Quickstart</doc-header><doc-caption>Starting a new project.</doc-caption><p>Once your environment is all setup, starting a new project is easy. The <b>quickstart-angular</b> framework is hosted on GitHub and no external dependencies are required. This is ideal, because we will clone this repo, quickly adapt to our new project and hit the ground running.</p><h5>Step-by-step instructions:</h5><ol><li>Create new repo on Github and title the repo to the name of your project.</li><li>Clone the <b><a href=\"https://github.com/AdvantageIntegratedSolutions/quickstart-angular.git\" target=\"_blank\">quickstart-angular</a></b> repo and provide the name of your new project.<doc-command>git clone https://github.com/AdvantageIntegratedSolutions/quickstart-angular.git new-app-name</doc-command></li><li>Update the git origin remote with your app\'s repo url.<doc-command>git remote set-url origin new-repo-git-url</doc-command></li><li>Install node modules at the root of your new project folder.<doc-command>npm install</doc-command></li><li>Configure the \'config/app.config.js\' file to your new project.</li><li>Start your local server on \'localhost:3000\'.<doc-command>gulp local</doc-command></li><li>You are all setup. Visit \'localhost:3000\' to view your project.</li></ol></doc-section>");
